submittedFiles.workflow:
version development

import "contam_testing.wdl" as contam_testing

task sort {

  input {
    File input_file String output_file
  }

   command <<<
     sort ~{input_file} > ~{output_file}
   >>>

   runtime {
     docker: "debian:stretch-slim"
   }

   output {
     File sorted_output = "${output_file}"
   }

}

workflow test_contam_testing {

  input {
        Map[String, Map[String, Pair[Array[File], File]]] samples
        Array[OrgBlastDB]+ org_blast_databases
        Array[IDBlastDB] id_blast_databases
        File taxon_names_cdb
        File taxon_paths_cdb # AKA cdb_index_mapping_taxon_ids_to_paths
        String output_prefix
        Boolean? create_homopolymer_report
        Float? suppress_reads_homopolymer_cutoff
        Boolean? use_total_retrieval_sequences
        Int read_name_format
        Int? number_of_reads
        Int? number_of_sets
        String? fq_fa_or_bam
  }

  call contam_testing.contam_testing {
    input:
        samples = samples,
        org_blast_databases = org_blast_databases,
        id_blast_databases = id_blast_databases,
        taxon_names_cdb = taxon_names_cdb,
        taxon_paths_cdb = taxon_paths_cdb,
        output_prefix = output_prefix,
        create_homopolymer_report = create_homopolymer_report,
        suppress_reads_homopolymer_cutoff = suppress_reads_homopolymer_cutoff,
        use_total_retrieval_sequences = use_total_retrieval_sequences,
        read_name_format = read_name_format,
        number_of_reads = number_of_reads,
        number_of_sets = number_of_sets,
        fq_fa_or_bam = fq_fa_or_bam
  }

  call sort {
    input:
      input_file=contam_testing.final_org_hit_based_reports[1],
      output_file="sorted_final_org_hit_based_reports"
  }

  output {
    Array[File] org_hit_based = [sort.sorted_output]
    Array[File] org_read_details = contam_testing.final_org_read_details_reports
    Array[File] org_read_based = contam_testing.final_org_read_based_reports
  }

}
